import { Form, Button, Nav, Navbar } from 'react-bootstrap';
import { NavLink } from 'react-router-dom'

import './Header.css'

function Header({ props }) {

  const classToggle = 'show';
  const changeState = () => {
    classToggle = 'hide';
  }

  return (
    <div>
      <Navbar className={classToggle} bg="dark" variant="dark">
        <Navbar.Brand href="/news">DailyNews</Navbar.Brand>
        <Nav className="mr-auto">
          <Nav.Link href="/news">Início</Nav.Link>
          <Nav.Link href="#features">Assine</Nav.Link>

        </Nav>
        <Form inline>
          <NavLink to="/login" exact>
            <Button variant="outline-info" onClick={changeState}>Entrar</Button>
          </NavLink>
        </Form>
      </Navbar>
    </div>
  );
}

export default Header;
